$(function () {
    //	pcç«¯è°ƒç”¨çª—å£æ»šåŠ¨æ¡
    if (isPC()) {
        niceScroll();
        $('.monavmain').css('margin-right', '-17px');
    } else {
        $('.monavmain').css('margin-right', 0);
    }
})

//åˆ¤æ–­å®¢æˆ·ç«¯æ˜¯å¦ä¸ºPC
function isPC() {
    var userAgentInfo = navigator.userAgent;
    var Agents = new Array("Android", "iPhone", "SymbianOS", "Windows Phone", "iPad", "iPod");
    var flag = true;
    for (var v = 0; v < Agents.length; v++) {
        if (userAgentInfo.indexOf(Agents[v]) > 0) { flag = false; break; }
    }
    return flag;
};
//çª—å£æ»šåŠ¨æ¡
function niceScroll() {
    var htmlNs = $("html").niceScroll({
        zindex: 9999,
        cursorwidth: 10,
        cursorborder: 0,
        cursoropacitymin: 0.3,
        cursoropacitymax: 0.8,
        horizrailenabled: false
    });
    htmlNs.cursor.css({ width: 5 });
    var objNs = (htmlNs.ispage) ? htmlNs.rail : htmlNs.win;
    objNs.hover(function () {
        htmlNs.state = true;
        htmlNs.cursor.stop().animate({ width: 10 }, 100);
    }, function () {
        if (htmlNs.rail.drag) {
            htmlNs.cursor.css({ 'opacity': '0.8' });
            return;
        }
        htmlNs.cursor.stop().animate({ width: 5 }, 100);
    });
    $(document).mouseup(function () {
        if (htmlNs.state) {
            htmlNs.state = false;
            htmlNs.cursor.stop().animate({ width: 5 }, 100);
        }
    });
};


